import React from "react";
import './createLotPopup.css';
import '../App.css';
import helpIcon from '../assets/images/help-icon.svg';

const CreateLotPopup = () => {
    return(
        <div className="popup-outer-container">
            <div className="popup-inner-container">
                <div className="display_flex space_between">
                    <div className="pill-text-container">
                        <p className="pill-text">
                            Most Played
                        </p>
                    </div>
                    <div>
                        <img src={helpIcon}/>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default CreateLotPopup;
